    true,nt"url": null,nt"notes": "The National Agriculture Imagery Program
    Change 2002-2015 is a web mapping application hosted on the ArcGIS online FSA Organizational
    Subscription. This web application is based on the hosted ArcGIS Online map tour
    template. The application depicts NAIP imagery coverage starting in 2002 and ending
    in 2015. The information contained in the JPEG images contained in the tour was
    aquired from historical archives of imagery coverage at the Aerial Photography Field
    Office. Notation of change and highlights for each year was also derived from historical
    contracting sources at the Aerial Photography Field Office.",nt"license_title":
